/* eslint-disable react/prop-types */
import React from 'react';
import { Link } from 'react-router-dom';
function Card({ image, name, id, status }) {
  return (
    <div className="card">
      <Link to={`/details/${id}`}>
        <img src={image} alt="" />
        <p>s{name}</p>
        <p>{status}</p>
      </Link>
    </div>
  );
}

export default Card;
